openMd(model,truck) {
  this.modalService.open(model, { size: 'lg' });
  this.SelectedData.imei = truck.value.id;
  this.SelectedData.Latitude = truck.value.lat;
  this.SelectedData.Longitude = truck.value.lng;
  this.SelectedData.Speed = truck.value.speed;
  this.SelectedData.TimeStamp = truck.value.timeStamp;
  this.SelectedData.plate_no = truck.value.plate_no;
  this.SelectedData.last_sync = truck.value.last_sync;
  this.SelectedData.icon2 =  truck.value.icon2;
}

openMap(modal,Content) {
    var imei = '';
   if(this.SelectedIMEI.length > 14) {
    let truckDetails = this.trucks[this.SelectedIMEI];
    this.SelectedData.imei = truckDetails.id;
    this.SelectedData.Latitude = truckDetails.lat;      
    this.SelectedData.Longitude = truckDetails.lng;
    this.SelectedData.Speed = truckDetails.speed;
    this.SelectedData.TimeStamp = truckDetails.timeStamp;
    this.SelectedData.plate_no = truckDetails.plate_no;
    this.SelectedData.last_sync = truckDetails.last_sync;
    this.SelectedData.icon2 = truckDetails.icon2;  
    this.modalService.open(modal, { size: 'lg' });
   } else {
     for( let i = 0; i < this.AvlList.length; i++) {
        if(this.AvlList[i].plate_no == this.SelectedIMEI){
          imei = this.AvlList[i].imei;
          break;
        }
     }
     if(imei == ''){
       this.modalService.open(Content, { size: 'md' });
     }else{
      this.modalService.open(modal, { size: 'lg' });
      let truckDetails = this.trucks[imei];
      this.SelectedData.imei = truckDetails.id;
      this.SelectedData.Latitude = truckDetails.lat;      
      this.SelectedData.Longitude = truckDetails.lng;
      this.SelectedData.Speed = truckDetails.speed;
      this.SelectedData.TimeStamp = truckDetails.timeStamp;
      this.SelectedData.plate_no = truckDetails.plate_no;
      this.SelectedData.last_sync = truckDetails.last_sync;
      this.SelectedData.icon2 = truckDetails.icon2; 
     }
   }
}


  ngOnInit() {
    subject.subscribe((msg: String) => {
      let AvlData: TruckModel = JSON.parse(msg.split('#')[2]);
      if(AvlData){
      for (let truckIMEIKey in this.trucks){
          let truckDetails = this.trucks[truckIMEIKey];
          let endDate= new Date(AvlData.TimeStamp);
          let startdate= new Date();
          if(AvlData.imei === truckIMEIKey){
            truckDetails.last_sync=  Math.floor((startdate.getTime() - endDate.getTime()) / 1000);
            truckDetails.timeStamp= AvlData.TimeStamp;
            truckDetails.lat= AvlData.Latitude;
            truckDetails.lng= AvlData.Longitude;
            truckDetails.id= AvlData.imei;
            truckDetails.speed= AvlData.Speed; 
            truckDetails.status = AvlData.status;
            truckDetails.plate_no = '';
            if(AvlData.imei in this.plate_no){
            truckDetails.plate_no = this.plate_no[AvlData.imei].plate_no;
            }
            this.trucks[truckIMEIKey]=truckDetails;            
                }else{
                
                let newTruck={
                id: AvlData.imei,
                last_sync: Math.floor((startdate.getTime() - endDate.getTime()) / 1000),
                lat: AvlData.Latitude,
                lng: AvlData.Longitude,
                timeStamp: AvlData.TimeStamp,
                speed: AvlData.Speed,
                status: AvlData.status,
                icon2: {
                  url: "./assets/"+AvlData.status+".png",
                  scaledSize: {
                    width: 30,
                    height: 30,
                  },
                },
                plate_no: ''
              }
              if(AvlData.imei  in this.plate_no){
                newTruck.plate_no = this.plate_no[AvlData.imei].plate_no;
                }
              this.trucks[AvlData.imei]= newTruck;
              break;
                }
    }
  }
  },
  err => console.log(err));
  }

